   "source": [
    "**Observaciones:**\n",
    "\n",
    "- **Número de muertes:** Todos los accidentes recogidos en estos datos reportan una muerte como mínimo. El accidente más grave registró ocho víctimas, y la distribución muestra claramente que la mayoría de los accidentes resultan en una sola muerte.\n",
    "\n",
    "- **Conductores bebidos involucrados en el accidente:** Se analiza con más detalle este dato más adelante para derivar una nueva métrica: Accidentes donde el alcohol está presente o no. En un primer vistazo, la media es de 0.26% de accidentes en los que interviene un conductor bebido. La franja de conductores bebidos por accidente va desde un conductor como mínimo hasta cuatro como máximo."
   ]
  },
